import "./App.css";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Login from "./components/Login";
import Postingan from "./components/Postingan";

const Home = () => {
    return (
        <div id="home">
            <h1>Aplikasi JWT</h1>
            <Link to="/login">
                <button className="btn btn-warning me-2">Login</button>
            </Link>
            <Link to="/postingan">
                <button className="btn btn-primary">Cek Postingan</button>
            </Link>
        </div>
    );
};

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Home />}></Route>
                    <Route path="/login" element={<Login />}></Route>
                    <Route path="/postingan" element={<Postingan />}></Route>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
